import React from "react";
import styles from "./Words.module.css";

const Words = () => {
  const namjestaj = 'NAMJEŠTAJ PO';
//   const po = 'PO';
  return (
    <div>
      <div className={styles.wordNamjestaj}>
          {namjestaj.split('').map((letter, index) => (
               <span key={index}>{letter !== '' ? letter : ' \u00A0'}</span>
          ))}
      </div>
        {/* <span>N</span>
        <span>A</span>
        <span>M</span>
        <span>J</span>
        <span>E</span>
        <span>Š</span>
        <span>T</span>
        <span>A</span>
        <span>J</span> */}
        <span className={styles.space}></span>
        {/* <span>&nbsp;</span> */}
        {/* <span>P</span>
        <span>O</span> */}
      {/* </div> */}
      <div className={styles.wordVasoj}>
        <span>V</span>
        <span>A</span>
        <span>Š</span>
        <span>O</span>
        <span>J</span>
        <span className={styles.space}></span>
        <span>M</span>
        <span>J</span>
        <span>E</span>
        <span>R</span>
        <span>I</span>
      </div>
      <div className={styles.sentence}>
        <span>Naručite i Vi Vašu kuhinju iz snova !</span>
      </div>
    </div>
  );
};

export default Words;
